function Home(){
    return <>
        This is Home

        <h1>What the club is about and goals</h1>

        <Link to="/Events">Check out our upcoming events</Link>
        <h1>What are the programmes / initiatives from this club</h1>

        <h1>How to contact and join the club</h1>
    </>
}

export default Home;
